import SwiftUI

// 用户数据结构体
struct User: Identifiable {
    let id = UUID()
    let avatarBase64: String // Base64编码的头像
    let nickname: String // 用户昵称
    let postCount: Int // 发帖数量
    let followCount: Int // 关注数量
    let lastUpdate: Date // 最后更新时间
    
    // 将Base64转换为Image
    var avatarImage: Image {
        if let data = Data(base64Encoded: avatarBase64),
           let uiImage = UIImage(data: data) {
            return Image(uiImage: uiImage)
        }
        return Image(systemName: "person.circle") // 默认头像
    }
}

