// CosmosView
struct CosmosView: View {
    @State private var selectedTab: Int = 0 // 0: Trusted, 1: All Visible
    
    var body: some View {
        NavigationView {
            VStack {
                // Tab按钮
                HStack(spacing: 0) {
                    TabBtn(title: "Trusted", isSelected: selectedTab == 0) {
                        selectedTab = 0
                    }
                    TabBtn(title: "Visible", isSelected: selectedTab == 1) {
                        selectedTab = 1
                    }
                }
                .padding(.top, 10)
                
                // 用户列表
                List(selectedTab == 0 ? trustedUsers : allVisibleUsers) { user in
                    NavigationLink(destination: UserDetailView(user: user)) {
                        UserRow(user: user)
                    }
                }
                .listStyle(PlainListStyle())
                .ignoresSafeArea()
                .navigationTitle("Cosmos")
            }
        }
    }
}

// Tab按钮组件
struct TabBtn: View {
    let title: String
    let isSelected: Bool
    let action: () -> Void
    
    var body: some View {
        Button(action: action) {
            Text(title)
                .font(.headline)
                .foregroundColor(isSelected ? .blue : .gray)
                .padding()
                .frame(maxWidth: .infinity)
                .background(isSelected ? Color.blue.opacity(0.1) : Color.clear)
                .cornerRadius(8)
        }
    }
}

// 用户列表行组件
struct UserRow: View {
    let user: User
    
    var body: some View {
        HStack {
            if let imageData = Data(base64Encoded: user.avatarBase64) {
//                user.avatarImage
                if let uiImage = UIImage(data: imageData){
                    Image(uiImage:uiImage)
                        .resizable()
                        .scaledToFit()
                        .frame(width: 32, height: 32)
                        .clipShape(Circle())
                        .overlay(Circle().stroke(Color.white, lineWidth: 1))
                        .shadow(radius: 3)
                }
            }
            
            VStack(alignment: .leading) {
                Text(user.nickname)
                    .font(.headline)
                Text("Posts: \(user.postCount) | Following: \(user.followCount)")
                    .font(.subheadline)
                    .foregroundColor(.gray)
            }
            
            Spacer()
            
            Text(lastUpdateString(from: user.lastUpdate))
                .font(.caption)
                .foregroundColor(.gray)
        }
        .padding(.vertical, 5)
    }
    
    // 格式化最后更新时间
    private func lastUpdateString(from date: Date) -> String {
        let formatter = RelativeDateTimeFormatter()
        return formatter.localizedString(for: date, relativeTo: Date())
    }
}

// 用户详情页面
struct UserDetailView: View {
    let user: User
    
    var body: some View {
        VStack(alignment: .leading, spacing: 20) {
            HStack {
                user.avatarImage
                    .resizable()
                    .scaledToFit()
                    .frame(width: 100, height: 100)
                    .clipShape(Circle())
                
                VStack(alignment: .leading) {
                    Text(user.nickname)
                        .font(.title)
                    Text("Last Updated: \(lastUpdateString(from: user.lastUpdate))")
                        .font(.subheadline)
                        .foregroundColor(.gray)
                }
            }
            
            Divider()
            
            Text("Posts: \(user.postCount)")
                .font(.headline)
            Text("Following: \(user.followCount)")
                .font(.headline)
            
            Spacer()
        }
        .padding()
        .navigationTitle("User Details")
    }
    
    private func lastUpdateString(from date: Date) -> String {
        let formatter = RelativeDateTimeFormatter()
        return formatter.localizedString(for: date, relativeTo: Date())
    }
}

